Information
------------------------------

Burying King Tut
Follow a team of Egyptologists as they investigate Tutankhamun's burial.
Tutankhamun was one of the most famous characters in the entire ancient world - his fabulous treasures are now known the world over. This programme follows an international team of Egyptologists as they investigate his burial. Their painstaking detective work reveals his burial was a rush job. Reuse and recycling was the order of the day as powerful people competed to claim the young Pharaoh's vacant throne.

